window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"21.0.1","implementation":{"name":"cucumber-jvm","version":"7.11.2"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"19.0.2+7"},"os":{"name":"Mac OS X"},"cpu":{"name":"x86_64"}}},{"testRunStarted":{"timestamp":{"seconds":1714627849,"nanos":125691000}}},{"source":{"uri":"file:///Users/keerthimula/git/Team04_LMS_WebAutomaters_All/src/test/resources/Features/001_LMSPortal.feature","data":"@portal\nFeature: Homepage verification\n    \n    #1\n\tScenario: Verify admin is able to land on home page\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should land on the home page\n     \n    #2\n\tScenario: Verify admin is able to land on home page with invalid URL\n     Given Admin launch the browser\n     When  Admin gives the invalid LMS portal URL\n     Then  Admin should recieve 404 page not found error \n     \n    #3\n\tScenario: Verify for broken link in login page\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  HTTP response >= 400. Then the link is broken\n     \n    #4\n\tScenario: Verify the text spelling in the page\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see correct spellings in all fields\n    \n    #5\n\tScenario: Verify the company logo alignment\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see logo on the left  side\n    \n    #5+\n\tScenario: Verify the company logo is present\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see logo is present\n     \n    #6\n\tScenario: Verify application name\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see  LMS - Learning Management System\n    \n    #7\n\tScenario: Verify company name\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see company name below the app name\n     \n    #8\n\tScenario: Validate sign in content\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see \"Please login to LMS application\"\n     \n    #9\n\tScenario: Verify text field is present\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see <2> text fields\n     \n    #10\n\tScenario: Verify text on the first text field\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see \"User\" in the first text field\n     \n    #11\n\tScenario: Verify asterik next to user text\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see * symbol next to user text\n     \n    #12\n    Scenario: Verify text on the Second text field\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see \"Password\" in the second text field\n     \n    #13\n\tScenario: Admin should see * symbol next to password text\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see * symbol next to password text\n     \n    #14\n\tScenario: Verify the alignment of input fields for the login\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see input field on the centre of the page\n     \n    #15\n\tScenario: verify Login is present\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then  Admin should see Login button\n   \n   #16\n\tScenario: Verify the alignment of the login button\n     Given Admin launch the browser\n     When  Admin gives the correct LMS portal URL\n     Then see a Delete button on the top left hand side as Disabled\n \n @6_SearchBar\n Scenario: Verify Search bar on the Program page\n Then Admin should see Search bar with text as \"Search...\"\n \n @7_AddNewProgram\n Scenario: Validate Add New Program \n Then Admin should see a \"+A New Program\" button on the program page above the data table\n \n @8_Verifydatatable \n Scenario: Verify data table on the Program page\n Then Admin should see data table on the Manage Program Page with column headers\n \n @9_SortArrow\n Scenario: Verify Sort arrow icon on the data table\n Then Admin should see the sort arrow icon beside to each column header except Edit and Delete \n \n @10_CheckBox\n Scenario: Verify Check box on the data table\n When Admin should see the text as Showing x to y of z entries along with Pagination icon below the table\n Then Admin should see check box on the left side in all rows of the data table \n \n @11_EditDeleteButton\n Scenario: Verify Edit and Delete buttons\n When Admin should see the text as Showing x to y of z entries along with Pagination icon below the table\n Then Admin should see the Edit and Delete buttons on each row of the data table\n \n @12_CheckNumberOfRecords\n Scenario: Validate that number of records (rows of data in the table) displayed\n When Admin should see the text as Showing x to y of z entries along with Pagination icon below the table\n Then Admin should see the number of records displayed on the page are 5\n \n @ValidateProgramDetailsPopupWindow\n Scenario: Validate Program Details Popup window\n Given Admin is on Manage Program Page\n When Admin clicks <A New Program> button\n Then Admin should see a popup open for Program details with empty form along with <SAVE> and <CANCEL> button and Close(X) Icon on the top right corner of the window\n \n @14_ValidateInputFields\n Scenario: Validate input fields and their text boxes in Program details form \n Given Admin is on Manage Program Page\n When Admin clicks <A New Program> button\n Then Admin should see two input fields and their respective text boxes in the program details window\n \n @15_ValidateRadioButton\n Scenario: Validate radio button for Program Status \n Given Admin is on Manage Program Page\n When Admin clicks <A New Program> button\n Then Admin should see two radio button for Program Status\n \n @16_Emptyformsubmission\n Scenario: Empty form submission \n Given Admin is on \"Program Details\" Popup window\n When Admin clicks <Save>button without entering any data\n Then Admin gets a Error message alert \n \n @17_EnteronlyProgramName\n Scenario Outline: Enter only Program Name\n Given Admin is on \"Program Details\" Popup window\n When Admin enter value only in ProgramName using \"<SheetName>\" and <rowNumber> \n And Admin clicks Save Button\n Then admin gets a message alert for description\n\n  Examples: \n      | SheetName  | rowNumber |\n      | Program |   0 |\n\n\n @18_EnteronlyProgramDescription\n Scenario Outline: Enter only Program Description\n Given Admin is on \"Program Details\" Popup window\n When Admin enter value only in Program description using \"<SheetName>\" and <rowNumber> \n And Admin clicks Save Button\n Then Admin gets a message alert 'Name is required'ProgramName\n\n  Examples: \n      | SheetName  | rowNumber |\n      | Program |  1  |\n      \n\n @19_SelectStatusonly\n Scenario: Select Status only\n Given Admin is on \"Program Details\" Popup window\n When Admin selects only Status \n And Admin clicks Save Button\n Then Admin gets a message alert 'Name' and 'Description required'\n\t\n @20_ValidateInvalidValuesOntheTextcolumn\n Scenario Outline: Validate invalid values on the text column\n Given Admin is on \"Program Details\" Popup window\n When Admin enters only numbers or special char in name and desc column \"<SheetName>\" and <rowNumber> \n And Admin clicks Save Button\n Then Admin gets a Error message alert SpecialCharecters \n\t\n  Examples: \n      | SheetName  | rowNumber |\n      | Program |  2 |\n\t\n\n @21_ValidateClose(X)icononProgramDetailsform\n Scenario: Validate Close(X) icon on Program Details form\n Given Admin is on \"Program Details\" Popup window\n When Admin clicks Close(X) Icon on Program Details form\n Then Program Details popup window should be closed without savings\n\n @22_ValidateSaveButton \n Scenario Outline: Validate Save button on Program Details form\n Given Admin is on \"Program Details\" Popup window\n When Enter all the required fields with valid values \"<SheetName>\" and <rowNumber>\n And Admin clicks Save Button\n Then Admin gets a message \"Successful Program Created\" alert and able to see the new program added in the data table\n\n\tExamples: \n      | SheetName  | rowNumber |\n      | Program |  3 |\n\n @23_ValidateCancelbuttononProgramDetailsform\n Scenario: Validate Cancel button on Program Details form\n Given Admin is on \"Program Details\" Popup window\n When Admin clicks <Cancel>button \n Then Admin can see the Program details popup disappears without creating any program\n\n ##24_Edit Program\n @24_ValidateEditFeature\n Scenario: Validate Edit Feature\n Given Admin is on Manage Program Page \n When Admin should see the text as Showing x to y of z entries along with Pagination icon below the table\n Then Admin should see the number of records displayed on the page are 5\n And Admin clicks <Edit> button on the data table for any row\n Then Admin should see a popup open for Program details to edit\n\n @25_EditProgramName\n Scenario Outline: Edit Program Name\n Given Admin clicks <Edit> button on the data table for any row\n When Admin edits the Name column using \"<SheetName>\" and <rowNumber> \n And Admin clicks Save Button\n Then Admin gets a message \"Successful Program Updated\" alert and able to see the updated name in the table for the particular program\n\n\tExamples: \n      | SheetName  | rowNumber |\n      | Program |  4 |\n      \n @26_EditProgramdescription\n Scenario Outline: Edit Program description\n Given Admin clicks <Edit> button on the data table for any row\n When Admin edits the Description column in using \"<SheetName>\" and <rowNumber> \n And Admin clicks Save Button\n Then Admin gets a message \"Successful Program Updated\" alert and able to see the updated description in the table for the particular program  \n\n\tExamples: \n      | SheetName  | rowNumber |\n      | Program |  5 |\n      \n @27_ChangeProgramStatus \n Scenario: Change Program Status\n Given Admin clicks <Edit> button on the data table for any row\n When Admin changes the Status \n And Admin clicks Save Button\n Then Admin gets a message \"Successful Program Updated\" alert and able to see the updated status in the table for the particular program\n\n @28_ValidateInvalidValuesOntheTextColumn\n Scenario Outline: Validate invalid values on the text column\n Given Admin clicks <Edit> button on the data table for any row\n When Admin edit special char in name and desc column \"<SheetName>\" and <rowNumber> \n And Admin clicks Save Button\n Then Admin gets a Error message alert Edit program\n\n  Examples: \n      | SheetName  | rowNumber |\n      | Program |  6 |\n\n @29_ValidateCancelButtonOnEditPopup\n Scenario: Validate Cancel button on Edit popup\n Given Admin clicks <Edit> button on the data table for any row\n When Admin clicks <Cancel>button on edit popup \n Then Admin can see the Program details popup disappears and can see nothing changed for particular program\n\n @30_ValidateSavebuttononEditpopup\n Scenario: Validate Save button on Edit popup\n Given Admin clicks <Edit> button on the data table for any row\n When Admin clicks <Save>button on edit popup\n Then Admin gets a message \"Successful Program Updated\" alert and able to see the updated details in the table for the particular program\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/keerthimula/git/Team04_LMS_WebAutomaters_All/src/test/resources/Features/004_ManageProgram.feature"," urce":{"uri":"file:///Users/keerthimula/git/Team04_LMS_WebAutomaters_All/src/test/resources/Features/005_ManageBatch.feature","data":"@batch\nFeature: Batch Page Validation\n    \n \tBackground: Logged on the LMS portal\n        Given Admin is on the dashboard page after Login\n        When Admin clicks Batch from navigation bar\n    \n    #1    \n    Scenario: Validate landing in Batch page\n  \t Then Admin should see the Manage Batch in the URL\n  \t#2\n  \tScenario: Validate header in the Batch Page\n     Then Admin should see the \"Manage Batch\" in the header\n  \t#3\n  \tScenario: Validate pagination in the Batch Page\n  \t Then Admin should see the pagination controls under the data table\n   \t#4\n  \tScenario: Validate data table headers in the Batch Page\n  \t Then Admin Should see the data table with headers Batch name, Batch Description,Batch Status, No. of classes, Program Name, EditDelete\n    #5\n    Scenario: Validate Delete button in Batch Page\n     Then Admin should be able to see the Delete icon button that is disabled\n    #6\n    Scenario: Validate + A New batch in Batch Page\n     Then Admin should be able to see the + A New batch button\n    #7\n    Scenario: Validate data rows\n     Then Each row in the data table should have a checkbox\n    #8\n    Scenario: Validate data rows\n     Then Each row in the data table should have a edit icon that is enabled\n    #9    \n    Scenario: Validate data rows\n     Then Each row in the data table should have a delete icon that is enabled\n    \n    #11\n    #Scenario: Check if the fields exist in pop\n     #Given Admin clicks + A New Batch button\n     #When A new pop up with Batch details appears\n     #Then The pop up should include Name,Numberofclasses,Description,ProgramName,staus,Numberofclasses\n     \n     ####12\n    Scenario: Validate data rows\n    Then Each row in the data table should have a checkboxBatch\n      ###13\n    Scenario: Validate data rows\n    Then Each row in the data table should have a edit icon that is enabledBatch\n    \n     ###14\n    Scenario: Validate data rows\n    Then Each row in the data table should have a delete icon that is enabledBatch\n    \n     ##15\n     #Scenario: Validate row level delete icon\n    #Given The delete icon on row level in data table is enabled\t\n    #When Admin clicks the delete icon\t\n    #Then Alert appears with yes and No option\n    \n    ###16\n    #Scenario: Validate accept alert\n    # When Admin clicks the delete icon\n    #When You click yes option\n    #Then Batch deleted alert pops and batch is no more available in data table\n    \n    ###17\n    #Scenario: Validate reject alert\n    #When you click No option\t\n    #Then Batch is still listed in data table\n    \n    ##18\n    Scenario: Validate the delete icon below the header \n    Given None of the checkboxes in data table are selected\t\t\n    Then The delete icon under the Manage Batch header should be disabled\n     \n  \n  \t","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/keerthimula/git/Team04_LMS_WebAutomaters_All/src/test/resources/Features/005_ManageBatch.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@batch","id":"2e765a14-1e7a-4053-adb3-512bc368a584"}],"language":"en","keyword":"Feature","name":"Batch Page Validation","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"Logged on the LMS portal","description":"","steps":[{"location":{"line":5,"column":9},"keyword":"Given ","keywordType":"Context","text":"Admin is on the dashboard page after Login","id":"557b0967-8031-4911-8dfe-43258c18fcf5"},{"location":{"line":6,"column":9},"keyword":"When ","keywordType":"Action","text":"Admin clicks Batch from navigation bar","id":"b3ab30fc-f082-4aa9-ad80-f370e2e98730"}],"id":"28667ea4-49d7-4384-b15e-4669ceab8c49"}},{"scenario":{"location":{"line":9,"column":5},"tags":[],"keyword":"Scena
